import services.stepfunctions.CreateSupportWorkersRequest

class CreateSubscriptionDeserialisationTest extends AnyFlatSpec with Matchers with EitherValues {

  testData.zipWithIndex.foreach { case (line, index) =>
    it should s"deserialise realistic requests $index" in {
      withClue("JSON: " + line) {
        val actual = decode[CreateSupportWorkersRequest](line)
        actual should be(Symbol("right"))
      }
    }

  }

}

